function leftmostBuildingQueries(heights: number[], queries: number[][]): number[] {
    const n = heights.length;
    const nextSmallest = new Array(n).fill(-1);
    const stack: number[] = [];

    for (let i = 0; i < n; i++) {
        while (stack.length && heights[stack[stack.length - 1]] < heights[i]) {
            const idx = stack.pop()!;
            nextSmallest[idx] = i;
        }
        stack.push(i);
    }

    const ans: number[] = [];
    for (const [ai, bi] of queries) {
        let current = ai;
        while (current < bi) {
            if (nextSmallest[current] !== -1 && nextSmallest[current] <= bi) {
                current = nextSmallest[current];
            } else {
                break;
            }
        }
        if (current === bi) {
            ans.push(ai);
        } else {
            ans.push(-1);
        }
    }

    return ans;
};
